                                relieve the seller from liability unless non-member states’ requirements have been met.
                            </p>
                            <p style=""margin-top:10px; margin-right:10px;"">
                                If you are not attaching the Multistate Supplemental form, enter the two-letter postal abbreviation “NC” in
                                the boxes provided if you are claiming an exemption from sales and use tax imposed by the State of North
                                Carolina. If you are claiming an exemption from more than one member state, complete the SSUTA Certificate
                                of Exemption: Multistate Supplemental ");
            WriteLiteral(@"form
                            </p>

                            <p style=""margin-top:10px; margin-right:10px;"">
                                <b>2.&emsp;Single purchase exemption certificate: </b>
                                Check this box if this exemption certificate is being used for a
                                single purchase. Include the invoice or purchase order number for the transaction.
                            </p>

                            <p style=""margin-top:10px; margin-right:10px;"">

                                If this boxed is not checked, this certificate will be treated as a blanket certificate. A blanket certificate
                                continues in force so long as the purchaser is making recurring purchases (at least one purchase within a
                                period of twelve consecutive months) or until otherwise cancelled by the purchaser.
                            </p>

                            <p style=""margin-top:10p");
            WriteLiteral(@"x; margin-right:10px;"">
