                                identification number for you or your business must be included. Include your North Carolina sales and
                                use tax account ID number or North Carolina sales and use tax exemption number, as appropriate. If a
                                transaction does not require the use of a registration or exemption number, enter the Federal Employer
                                Identification Number (FEIN) issued to your business, or if no FEIN is required, enter your personal driver’s
